import Axios from 'axios'

const key = "Ar5rQjC12C3YKOyreth1FRYz_PCKMqFxlUws-UiFGzADputaJvj-NrCMI1yM_xBB"
const ax = Axios.create({
    baseURL: "http://dev.virtualearth.net/REST/v1/"
})

const ax_laravel = Axios.create({
    baseURL: "http://127.0.0.1:8000/api/v1/"
})

export const register = async ( params ) => {
    return await ax_laravel.post("register",  params )
}

export const signin = async ( params ) => {
    return await ax_laravel.post("login",  params )
}

// mosque
export const mosqueCreate = async ( params ) => {
    return await ax_laravel.post("mosqueCreate",  params )
}

export const mosqueList = async ( params ) => {
    return await ax_laravel.post("mosqueList",  params )
}


export const userLocationMap =  async () => {
    const params = {
        query: 'mosque',
        include: 'queryParse',
        key: key,
        output: 'json',
        CountryRegion: 'TR'
    }
    const url = 'Locations'
    return await ax.get(url, {params: params} )
}
